document.write('<h1><form onsubmit="return false;"><input class="keyword" type="text" name="pwd" id="pwd" onkeypress="checkEnter(event)"><input class="keyword" type="button" value=" Go to page " onClick="goToPage()"></form></h1>\n');

function checkEnter(event) {
    if (event.key === 'Enter') {
        event.preventDefault();
        goToPage();
    }
}

function goToPage() {
    try {
        var inputElement = document.getElementById('pwd');
        var userInput = inputElement.value;

        var regex = /^[a-zA-Z0-9]+$/;
        if (!regex.test(userInput)) {
            throw new Error("Input non valido! Usa solo caratteri alfanumerici (A-Z, a-z, 0-9).");
        }

        var sanitizedInput = userInput.replace(/[^a-zA-Z0-9]/g, '');

        var escapedInput = sanitizedInput.replace(/&/g, "&amp;")
                                          .replace(/</g, "&lt;")
                                          .replace(/>/g, "&gt;")
                                          .replace(/"/g, "&quot;")
                                          .replace(/'/g, "&#39;");

        window.location = 'pagina_' + escapedInput + '.html';
    } catch (error) {
        console.error("Si è verificato un errore:", error.message);
        alert(error.message);
    }
}

document.write( '</details>' );

function clearFormData() {
    var inputElement = document.getElementById('pwd');
    if (inputElement) {
        inputElement.value = '';
        inputElement.blur();
        
        if (inputElement.form) {
            inputElement.form.reset();
        }
        
        try {
            sessionStorage.removeItem('pwd');
            localStorage.removeItem('pwd');
            sessionStorage.clear();
        } catch(e) {
            console.log('Storage clearing handled');
        }
    }
}

function checkEnter(event) {
    if (event.key === 'Enter') {
        event.preventDefault();
        goToPage();
    }
}

function goToPage() {
    try {
        var inputElement = document.getElementById('pwd');
        var userInput = inputElement.value;

        var regex = /^[a-zA-Z0-9]+$/;
        if (!regex.test(userInput)) {
            throw new Error("Invalid input! Use only alphanumeric characters (A-Z, a-z, 0-9).");
        }

        var sanitizedInput = userInput.replace(/[^a-zA-Z0-9]/g, '');

        var escapedInput = sanitizedInput.replace(/&/g, "&amp;")
                                          .replace(/</g, "&lt;")
                                          .replace(/>/g, "&gt;")
                                          .replace(/"/g, "&quot;")
                                          .replace(/'/g, "&#39;");

        clearFormData();
        
        var encodedKeyword = btoa(escapedInput);
        
        var hash = 0;
        for (var i = 0; i < escapedInput.length; i++) {
            var char = escapedInput.charCodeAt(i);
            hash = ((hash << 5) - hash) + char;
            hash = hash & hash;
        }
        var hashedKeyword = Math.abs(hash).toString(16);
        
        var finalUrl = encodedKeyword + '_' + hashedKeyword;
        
        setTimeout(function() {
            window.location.hash = '#p_' + finalUrl;
            setTimeout(function() {
                window.location.replace('pagina_' + escapedInput + '.html');
            }, 100);
        }, 50);
        
    } catch (error) {
        console.error("An error occurred:", error.message);
        alert(error.message);
        clearFormData();
    }
}

window.onload = function() {
    clearFormData();
    
    var keywordElements = document.getElementsByClassName('keyword');
    for (var i = 0; i < keywordElements.length; i++) {
        keywordElements[i].style.padding = '10px';
        keywordElements[i].style.margin = '10px';
        keywordElements[i].style.fontSize = '16px';
        keywordElements[i].style.border = '2px solid #ACFA58';
        keywordElements[i].style.backgroundColor = '#2a2a2a';
        keywordElements[i].style.color = '#ACFA58';
        keywordElements[i].style.outline = 'none';
    }
    
    var inputElement = document.getElementById('pwd');
    if (inputElement) {
        inputElement.onfocus = function() {
            this.style.boxShadow = '0 0 10px #ACFA58';
        };
        inputElement.onblur = function() {
            this.style.boxShadow = 'none';
        };
    }
};


window.onpageshow = function(event) {
    if (event.persisted) {
        clearFormData();
    }
};


window.onbeforeunload = function() {
    clearFormData();
};


window.onblur = function() {
    clearFormData();
};


window.addEventListener('popstate', function(event) {
    if (event.state && event.state.isKeywordPage) {
        clearFormData();
        if (window.history && window.history.replaceState) {
            window.history.replaceState(null, '', '/');
        }
        window.location.replace('/');
    }
});

window.addEventListener('beforeunload', function() {
    if (window.history && window.history.replaceState) {
        window.history.replaceState(null, null, '/');
    }
});


window.addEventListener('pageshow', function(event) {
    if (event.persisted) {
        clearFormData();
        window.location.replace('/');
    }
});


document.write( '\n' );
document.write( '</form>\n' );
document.write( '</font></strong></center>' );


</script>
